sintonía entre la oficina y el medio ambiente.\r\n\r\nLa madera se combina con el cuero con soluciones de elevada artesanía. La relación entre diseño y proporciones destaca la elegancia y la belleza de las líneas limpias y suaves que caracterizan la pata y toda la superficie del tablero del escritorio donde la esencia de la madera, combinada con el cuero, cosido con gran delicadeza y precisión, es un ejemplo de fabricación de excelencia.','•	Combinación entre madera y piel. \r\n•	Disponible en combinaciones distintas de armado.','Sin medidas.','Madera y piel','Nogal americano y ebano y piel negra.','products/x10.webp','2021-09-22 17:34:46.959896','2021-10-21','','',''),(56,'RE-1361','Requiez','Sillón ejecutivo quadra respaldo alto y medio mesh, mecanismo multimodal, asiento acojinado con diseño ergonómico,descansabrazos 2D ajuste vertical y frontal, base de aluminio pulido. Cuerpo en polipropileno color gris.','•	Multimodal, elaborado con placa de acero cal. 10.\r\n•	Elevación neumática\r\n•	Ajuste independiente de ángulo asiento/respaldo.\r\n•	Reclinamiento mecánico del respaldo (Contacto permanente)\r\n•	Ajuste de respaldo por sistema lama.','•	Altura Piso-Asiento: 44 – 55 cm.\r\n•	Altura Fondo: 60 cm -64 cm.\r\n•	Altura Frente: 60 cm -64 cm.\r\n•	Altura Total: 116 – 120 cm.','Base de aluminio pulido de 5 puntas.\r\nRespado en mesh de poliester.\r\nAsiento de poliuretano inyectado de 53\r\nkg/m3.','Consulta carta de tapices','products/RE-1361-Azul.jpg','2021-09-22 21:45:54.264224','2021-10-01','products/RE-1361-Azul-Frontal.jpg','products/RE-1361-Verde.jpg','products/RE-1361-Verde-Frontal.jpg'),(57,'RE-1601','Requiez','Sillón Ejecutivo en mesh / tela respaldo medio reclinamiento synchro auto-pesante con 3 ángulos de reclinamiento, profundidad de asiento slíder, descansabra-zos fijo, rodamientos duales con cubierta de poliuretano, asiento ergonómico acojina-do de alta densidad con retardante al fuego y elevación neumática.','•	Reclinamiento Synchro autopesante con 