 total: 130.5 cm – 136.5 cm.','Laminado de madera','blanco, natural, oscura y medio','products/risefit-1.jpg','2021-09-25 18:53:10.748493','2021-10-12','products/risefit-2.jpg','products/risefit-3.jpg',''),(74,'Lives Lounge','Okamura','Las sillas de oficina de hoy demandan más que funcionalidad. Los espacios relajados de estilo residencial crean entornos de trabajo donde los trabajadores se expresan y prosperan. Las sillas Lives brindan un aspecto informal a la oficina y están equipadas con las características más avanzadas que los empleados esperan.','• Lives Work Lounge Chair\r\n• La silla lounge no es solo para relajarse. Está diseñado para mantener la parte inferior del cuerpo relajada mientras mantiene la columna vertebral y el cuello erguidos para una postura ideal para el trabajo.','• Ancho respaldo: 70.5 cm.\r\n• Bazo derecho-izquierdo: 76 cm.\r\n• Ancho asiento: 57 cm.\r\n• Altura piso-brazo: 62.8 cm.\r\n• Altura piso-asiento: 42.8 cm.\r\n• Diámetro base: 60 cm.\r\n• Perfil escoca: 69 cm.\r\n• Largo asiento: 49 cm.\r\n• Perfil con paleta: 80 cm.\r\n• Largo paleta: 49 cm.\r\n• Altura total: 125.8 cm.','Tela','Sage o Gris.','products/lives-1f.jpg','2021-09-25 18:54:23.570090','2021-10-12','products/lives-1v.jpg','products/lives-2f.jpg','products/lives-2v.jpg'),(75,'Leopard','Okamura','estar completamente diseñadas para la estética. Irónicamente, es el diseño innovador que realza la comodidad emulando el toque humano. Mientras te sientas, Leopard te abraza mientras la inclinación del asiento suavemente nivela para una transición sin fisuras en la silla. Para mayor comodidad, el respaldo de malla suspendida lo coloca en una inclinación de hasta 27 °.','• Base de anillo / base de 5 estrellas (con deslizadores)\r\n• Espalda media / alta\r\n• Cuerpo Negro / Blanco\r\n• Tapicería de tela / cuero','•Ancho respaldo: 44 cm.\r\n• Bazo derecho-izquierdo: 66.5 cm. .\r\n• Altura piso-brazo: 70.5 cm – 76.5 cm.\r\n• Altura piso-asiento: 44 cm – 50 cm.\r\n• Diámetro base: 77.7 cm.\r\n• Perfil escoca: 56 cm.\r\n• Largo asiento: 51 cm.\r\n• Altura total: 130.5 cm – 136.5 cm.','Mesh y piel.','Negro, beige.','products/leopard-2.jpg','2021-09-25 18:55:38.935067','2021-10-12','products/leopard-1.jpg','products/leopard-3.jpg',''),(76,'Brek','Labenze','Sillón con estructura interna en acero recubierto en poliurentano inyectado y tapizado. Consultar carta de tapices. compatible con las siguientes bases: Base L3 Natural/Wenghé/Nogal, Base R3 cromo, Base R3 Negro, Base R3 Blanco, Base P3 cromo, Base P3 Negro, ,Base P3 Blanco, Base R10 aluminio, Base R10 Negro, L17  Natural/Wenghé/Nogal, Base D1 acero inóxidable, Base S5 Negro, ,Base S5 Blanco,  Base S5 cromo,Base R16 aluminio negro, Base R16 aluminio blanco, Base P4 cromo, Base P4 Negro, Base P4 Blanco.','•	Para uso Interno.\r\n•	Disponible en variedad de bases.                                                                                                                       •	Consulta carta de tapices para selección del color.','•	Altura total: 83 cm.\r\n•	Piso – asiento: 46 cm.\r\n•	Perfil: 60 cm.\r\n•	Ancho base: 61 cm.','Poliuretano inyectado.','Consultar carta de tapices.','products/brek-1.jpg','2021-09-25 18:56:43.386474','2021-10-12','products/brek-2.jpg','products/brek-3.jpg','products/brek-5.jpg'),(77,'Kira','Labenze','Sillón de 1 plaza cuerpo en poliuretano inyectado y tapizado.\r\nCompatible con las siguientes bases: Base L3 Natural/Wenghé/Nogal, Base L17 Natural/Wenghé/Nogal, Base R3 Cromo, Base R3 Negro, Base R3 Blanco, Base L3, Base P3 Cromo, Base P3 Negro, Base P3  Blanco, Base R10 aluminio, Base R10 negro, Base R10 aluminio, Base D1 acero inóxidable, Base S5 negro, Base S5 cromo, Base S5 blanco,  Base R16 aluminio negro,  Base R16 aluminio blanco, Base P4 Cromo, Base P4 Negro, Base P4  Blanco.','•	Para uso Interno.\r\n•	Disponible en variedad de bases.                                                                                                                       •	Consulta carta de tapices para selección del color.','•	Altura total: 81 cm.\r\n•	Piso – asiento: 44 cm.\r\n•	Perfil: 59 cm.\r\n•	Ancho base: 63 cm.','Poliuretano inyectado.','Consultar carta de tapices.','products/kira-1.jpg','2021-09-25 18:58:31.499408','2021-10-12','products/kira-5.jpg','products/kira-7.jpg','products/kira-8.jpg'),(78,'Mesa landing','Okamura','LANDING ES LA SÍNTESIS COMPOSITIVA ENTRE LIGEREZA Y SOLIDEZ. LA HORIZONTALIDAD DE LA PARTE SUPERIOR DESCANSA EN LA PUNTA DE LA BASE PIRAMIDAL, EN UN EQUILIBRIO MÁGICO QUE LA CONVIERTE EN UNA PIEZA ÚNICA EN SU TIPO. LANDING ES UNA MESA CON LÍNEAS ESENCIALES, QUE HACE DE LA PUREZA Y LA SIMPLICIDAD LAS CARACTERÍSTICAS DISTINTIVAS DE UN DISEÑO ARQUETÍPICO Y ATEMPORAL. LA PRESENCIA ESCULTÓRICA Y EL AMPLIO ESPACIO LIBRE DEBAJO DE LA MESA LO CONVIERTEN EN UNA PIEZA ÚNICA TANTO EN EL HOGAR COMO EN ESPACIOS REPRESENTATIVOS, ADEMÁS DE SER IDEAL EN SALAS DE REUNIONES.','•	Para uso Interno.\r\n•	Elegancia y diseño.','•	Altura total: 75 cm.\r\n•	Cubierta: 120 cm x 250 cm o 120 cm x 300 cm','Consulte para más información.','Negro','products/Landing-a.jpg','2021-09-25 19:00:19.366561','2021-10-18','products/Landing-b.jpg','',''),(79,'Contessa','Okamura','Desde 2002, Contessa ha establecido el estándar para los asientos de oficinas en todo el mundo. Ahora, ella renace como Contessa Seconda. Contessa Seconda une las líneas fluidas y orgánicas y el encanto del original con una nueva ingeniería y funcionalidad. Con más opciones de color para la malla, tela y marco. Todo para satisfacer las exigencias del estilo de trabajo moderno. Contessa Seconda es la evolución de un ícono, para el lugar de trabajo de hoy y del mañana.','•	Diseñado para oficinas modernas.\r\n•	Construido con nuevos estándares de resistencia, para cumplir con los requisitos de las sillas de trabajo de hoy.\r\n•	Comodidad personal.\r\n•	Okamura aprovecha su tecnología de renombre mundial para la comodidad y un ajuste excelente para cada cuerpo.\r\n•	Nuevos colores y opciones de marcos.\r\n•	Disponible en una paleta emocionante, líder en la industria, pero refinada. También está disponible una opción de marco blanco.\r\n•	Gama ampliada para cualquier espacio La gama completa de Contessa Seconda se adapta a salas de conferencias, áreas de reuniones, retoques y aplicaciones de tareas.\r\n•	Opciones de estilo.\r\n•	Silla giratoria de 5 estrellas / Taburete alto / Devolución automática / Reunión de 4 estrellas.\r\n•	Marco: Pulido / Plata / Negro.\r\n•	Color de cuerpo: Blanco / Gris / Negro Apoyabrazos: brazos ajustables / brazos fijos.\r\n•	Asiento: Cojín / Malla','Todos los accesorios:\r\n• Ancho respaldo: 50.2\r\n• Bazo derecho-izquierdo: 65 cm – 70.2 cm. .\r\n• Ancho asiento: 52 cm.\r\n• Altura piso-brazo: 61.5cm – 84.2 cm.\r\n• Altura piso-asiento: 43.4 cm – 54.4 cm.\r\n• Altura piso-brazo:62.3 cm – 72.3 cm.\r\n• Diámetro base: 70 cm.\r\n• Perfil escoca con porta sacos: 58.5 -63.5 cm.\r\n• Largo asiento: 40 cm – 45 cm.\r\n• Altura total: 119.9 cm – 132.9 cm.\r\n\r\nSin cabecera:\r\n• Ancho respaldo: 50.2\r\n• Bazo derecho-izquierdo: 65 cm – 70.2 cm. .\r\n• Ancho asiento: 52 cm.\r\n• Altura piso-brazo: 61.5cm – 84.2 cm.\r\n• Altura piso-asiento: 43.4 cm – 54.4 cm.\r\n• Altura piso-brazo:62.3 cm – 72.3 cm.\r\n• Diámetro base: 70 cm.\r\n• Perfil escoca: 58.5 -63.5 cm.\r\n• Largo asiento: 40 cm – 45 cm.\r\n• Altura total: 100.5 cm – 113.2 cm.','Mesh y piel','Negro y gris claro','products/contessa-1f.jpg','2021-09-25 19:01:52.966775','2021-10-12','products/contessa-2f.jpg','products/contessa-3.jpg','products/contessa-5.jpg'),(80,'Sylphy','Okamura','Okamura entiende que las personas son diferentes. Para acomodar diferentes tipos de cuerpos, desarrollamos una curva de asiento única y fácilmente ajustable que soporta una amplia gama de tamaños de espalda. El ajuste de la curva posterior ayuda a Sylphy a lograr una comodidad de asiento personalizada para toda la oficina.','• El Ajuste de la Curva Trasera equipa a Sylphy para acomodar cualquier tipo de cuerpo. Al tirar de las palancas a ambos lados del respaldo del asiento, la curva se vuelve más suave para ajustarse a una construcción grande. Tirando de las palancas hacia arriba crea una curva estrecha para apoyar una figura más pequeña.\r\n• El Marco Hovering tiene una ligera flexión, permitiendo al usuario estirarse y moverse mientras mantiene una sana curva S de la columna vertebral.\r\n• El cojín de asiento multidensidad distribuye el peso corporal uniformemente para reducir los puntos de presión y mejora la circulación sanguínea para una sesión sana y una comodidad superior.\r\n• La perilla Quick and Easy Recline Adjustment le permite controlar con precisión la resistencia reclinable. La fuerza de la resistencia se puede ajustar de la tensión máxima a la mínima con sólo dos giros completos de la perilla de ajuste-siempre con reclinación sincronizada de tobillo-inclinación.\r\n• El dial Recline y Tilt Lock le permite bloquear Sylphy en reclinación de hasta 23 ° o inclinación hacia adelante de 10 °.\r\n• Opciones de estilo\r\n• Parte trasera alta / espalda alta / espalda baja\r\n• Malla elástica de espalda / Tapicería\r\n• La malla y la tela están disponibles en 12 variaciones del color.\r\n• Opción de personalización\r\n• Apoyabrazos: Ajustable / Fijo / Sin Armadura\r\n• Base de aluminio pulido o base de resina negra\r\n• Color del cuerpo: Negro o blanco\r\n• Extras opcionales\r\n• Reposacabezas (Fijo)\r\n• Perchero','Respaldo Alto:\r\n•	Ancho respaldo: 51.5cm.\r\n•	Bazo derecho-izquierdo: 64.8 cm.\r\n•	Ancho asiento: 46 cm.\r\n•	Altura piso-brazo: 58cm – 81 cm.\r\n•	Altura piso-asiento: 42.6 cm – 55.6 cm.\r\n•	Diámetro base: 70 cm. • Perfil escoca: 57.4 -62.4 cm.\r\n•	Largo asiento: 41 cm – 46 cm.\r\n•	Altura total: 96 cm – 109 cm.\r\n\r\nRespaldo Bajo:\r\n• Ancho respaldo: 51.5cm.\r\n• Bazo derecho-izquierdo: 64.8 cm. .\r\n• Ancho asiento: 46 cm.\r\n• Altura piso-brazo: 58cm – 81 cm.\r\n• Altura piso-asiento: 42.6 cm – 55.6 cm.\r\n• Diámetro base: 70 cm.\r\n• Perfil escoca: 57.4 -62.4 cm.\r\n• Largo asiento: 41 cm – 46 cm.\r\n• Altura total: 89 cm – 102 cm.','Tela y mesh','Negro, gris claro, azul aqua.','products/sylphy-1fb.jpg','2021-09-25 19:06:32.848537','2021-10-12','products/sylphy-1f.jpg','products/sylphy-3fb.jpg','products/sylphy-3f.jpg'),(81,'Plimode','Okamura','Plimode es como un traje hecho a medida por un maestro artesano-la atención se centra en cada puntada, cada detalle, cada ajuste y cada acabado. No sólo encaja tan cómodamente como adaptado a medida de ajuste, el paño en el respaldo y el asiento se han aplicado minuciosamente para asegurarse de que no hay lagunas, divisiones o pliegues. Es una obra de ingeniería de 70 años en la fabricación de la oficina con cada poco de la artesanía y el diseño de la casa de Okamura tiene para ofrecer. Cada pedacito de la tecnología en nuestra disposición ha ido en el diseño y la comodidad de Plimode. Nuestras avanzadas técnicas de moldeo de resina han producido apoyabrazos con una curva moderna y aerodinámica. El mecanismo reclinable se ha simplificado en un diseño limpio, moderno, minimalista. Bajo el asiento, encontrará un grupo de control compacto. Tecnología e ingenio entretejidos en una calidad sin precedentes.','•	Construcción de Malla Interior\r\n•	Esta construcción ofrece la comodidad superior y la transpirabilidad que normalmente no se espera de una silla de conferencia. La estructura interna de la malla hace que el respaldo sea casi imposiblemente delgado.\r\n•	Funcionamiento inteligente de la diapositiva\r\n•	Consolidamos los controles en un grupo simple debajo del asiento; Todo es accesible desde una posición natural sentado. La tensión de reclinación se controla con una simple palanca deslizante.\r\n•	Cojín de asiento multidensidad\r\n•	El asiento distribuye el peso corporal uniformemente para reducir los puntos de presión y mejora la circulación sanguínea para una sesión sana y una comodidad superior.\r\n•	Opciones de estilo\r\n•	Espalda alta / espalda media\r\n•	Base de piernas de cinco estrellas / Base de piernas de cuatro estrellas / Taburete alto\r\n•	Estructura: Aluminio / Plástico\r\n•	Color de la carrocería: Negro / Blanco\r\n•	Brazos: Alminio / Plástico / Sin Brazo','• Ancho respaldo: 43 cm\r\n• Bazo derecho-izquierdo: 49 cm. .\r\n• Altura piso-brazo: 61.5cm – 84.2 cm.\r\n• Altura piso-asiento: 44 cm – 55 cm.\r\n• Altura piso-brazo:64 cm – 75 cm.\r\n• Diámetro base: 69.6cm.\r\n• Perfil escoca: 57.7 cm.\r\n• Largo asiento: 42.5 cm.\r\n• Altura total: 93 cm – 104 cm.','Tela','Gris claro- marco blanco\r\nSage- marco blanco\r\nNegro- marco negro.\r\nGris oscuro- marco negro.','products/plimode-1f.jpg','2021-09-25 19:07:31.688308','2021-10-12','products/plimode-1v.jpg','products/plimode-2f.jpg','products/plimode-2v.jpg'),(82,'RE-7000','Requiez','Sillón ejecutivo dynamic con cabecera Dynamic (mesh – tela) sistema reclinamiento synchronico con 4 posiciones con maneral para regular la tensión y antishock, ajuste de profundidad de asiento. Descansabrazos con ajuste de altura y codera suave al tacto, soporte lumbar independiente, base y marco estructural de aluminio pulido, cabecera ajustable','•	Cabecera con ajuste de altura gradual y posición de ángulo.\r\n•	Descansabrazos con 7 posiciones de altura, codera de poliuretano y cubierta de aluminio pulido. \r\n•	Soporte lumbar independiente con ajuste de altura. \r\n•	Asiento con diseño ergonómico con acojinamiento de poliuretano inyectado de 53 kg/m3 de densidad con retardante de flama.\r\n•	Respaldo con diseño ergonómico en red de nylon con marco estructural de aluminio.','•	Altura total: 120 - 135 cm.\r\n•	Piso – asiento: 47 - 55 cm.\r\n•	Perfil: 64 - 68 cm.\r\n•	Ancho base: 64 - 70 cm.','Mesh y aluminio pulido','Consulta carta de tapices','products/RE-7000.jpg','2021-09-25 19:08:46.689746','2021-10-01','products/RE-7000-frontal.jpg','',''),(83,'Nizza','Labenze','Silla con asiento y respaldo en polipropileno, con base de 4 patasen tubular de acero c