,'Repiroue','Okamura','No es ningún secreto que cambiar nuestra postura a lo largo del día es esencial para nuestro bienestar en la oficina. Además, la adaptación de una postura adecuada para la tarea en cuestión ayuda a aliviar el estrés que se ejerce sobre el cuerpo. Okamura recomienda cinco posturas para aumentar la productividad y la eficiencia de la oficina. Entre ellos se encuentra la postura de posado, una combinación perfecta de estar de pie y sentarse, que es adecuada para una reunión de pie o para realizar tareas de toma de contacto. Repiroue fue traído a la vida con la intención de hacer que la postura de posado sea más accesible en el entorno de la oficina.','• Al distribuir el peso entre las piernas y los glúteos, la posición de percha minimiza la tensión ejercida en la parte inferior de la espalda y las piernas para una postura de trabajo cómoda.\r\n• Repiroue naturalmente atrae la pelvis hacia adelante, creando una curva s sana en la columna vertebral.\r\n• La base permanece completamente en el suelo, creando una experiencia de asiento estable, incluso cuando el usuario se mueve.\r\n• Repiroue se inclina con el cuerpo 10 ° en cualquier dirección para soportar aproximadamente el 60% del peso del usuario.\r\n• Se puede acceder fácilmente a la palanca de ajuste de altura debajo del asiento desde cualquier ángulo para ajustar la altura entre 565 mm (22 1/4 \") y 815 mm (32 1/8\").\r\n• Opciones de estilo\r\n• Color de la carcasa: Blanco / Negro','• Ancho asiento: 30 cm.\r\n• Diámetro base: 35 cm.\r\n• Altura total: 56.5 cm – 81.5 cm.','Tela','Negro o blanco','products/repiroue-1.jpg','2021-09-28 14:40:07.563882','2021-10-12','products/repiroue-2.jpg','',''),(91,'RM-9000','Requiez','Sillón presidencial asiento y respado ergonomico en mesh con reclinamiento y 3 posiciones de bloqueo, ajuste de profundiad de asiento y altura de respaldo con soporte lumbra flotante. Descansa brazos ajustable.','•	Reclinamiento Synchro monomando con regulador de tensión.\r\n•	3 posiciones de bloqueo y sistema antishock.\r\n•	Sistema slider para ajuste de profundidad de asiento.\r\n•	Cubierta de mecanismo en polipropileno de alta resistencia.\r\n•	Elevación neumática.                                                                                                                                           \r\n•	Ajuste de respaldo gradual.                                                                                                                                      \r\n•	Descansa brazos con ajuste 3D.                                                                                                                          \r\n•	Respaldo ergonómico con soporte lumbar.                                                                                                  \r\n•	Cabecera con ajuste de altura gradual en tres posiciones.','•	Altura total: 116 - 120 cm.\r\n•	Piso – asiento: 44 - 55 cm.\r\n•	Perfil: 60 - 64 cm.\r\n•	Ancho base: 60 - 64 cm.','Base de aluminio pulido de 5 puntas.\r\nRespaldo en mesh de poliester.\r\nDescansa brazos en aluminio pulido.','Negro','products/RM-9000.jpg','2021-09-28 14:42:03.959671','2021-10-12','products/RM-9000_Frontal.jpg','',''),(92,'RP-8000','Requiez','Sillón ejecutivo en piel respaldo alto con cabecera integrada, acojinamiento en poliuretano inyectado de alta densidad con retardante al fuego, brazos de aluminio pulido con codera acojinada y base en aluminio pulido, sistema de reclinamiento con bloque en 4 posiciones y regulador de tensión.','•	Reclinamiento knee Tilt con cuatro posiciones de bloqueo con sistema anti-shock y perilla para regular la tensión.                                                                                                                  \r\n•	Brazos de aluminio pulido, con codera acojinada.\r\n•	Elevación Neumática.','•	Altura total: 123 - 130 cm.\r\n•	Piso – asiento: 50 - 57 cm.\r\n•	Perfil: 70 cm.\r\n•	Ancho base: 65 cm.','Base de 5 puntas elaborada en aluminio.\r\nAsiento y respaldo tapizado en piel.\r\nPoliuretano inyectado de alta densidad de 53 kg/m3 con retardante al fuego.','Negro y café','products/RP-8000_negro.jpg','2021-09-28 14:43:04.527304','2021-10-12','products/RP-8000.jpg','products/RP-8000_beige.jpg',''),(93,'RE-7050','Requiez','Sillón ejecutivo dynamic con cabecera Dynamic (mesh – piel) sistema reclinamiento synchronico con 4 posiciones con maneral para regular la tensión y antishock, ajuste de profundidad de asiento. Descansabrazos con ajuste de altura y codera suave al tacto, soporte lumbar independiente, base y marco estructural de aluminio pulido, cabecera ajustable','•	Cabecera con ajuste de altura gradual y posición de ángulo.\r\n•	Descansabrazos con 7 posiciones de altura, codera de poliuretano y cubierta de aluminio pulido. \r\n•	Soporte lumbar independiente con ajuste de altura. \r\n•	Asiento con diseño ergonómico con acojinamiento de poliuretano inyectado de 53 kg/m3 de densidad con retardante de\r\n•	flama. \r\n•	Respaldo con diseño ergonómico en red de nylon con marco estructural de aluminio.','•	Altura total: 115 - 128 cm.\r\n•	Piso – asiento: 45 - 55 cm.\r\n•	Perfil: 55 - 75 cm.\r\n•	Ancho base: 70 - 74 cm.','Mesh, piel y aluminio pulido','Piel negra','products/RP-7050_REQUIEZ.png','2021-09-28 14:44:05.870586','2021-10-15','products/RP-7050_02_REQUIEZ.png','',''),(94,'Sabrina','Okamura','En la filosofía de Okamura, la comodidad y el diseño no contradicen sino que se interconectan. Sabrina es otra representación de esto. Sostener y seguir el movimiento del cuerpo durante la experiencia al estar sentado - hecho posible con una sola pieza, una estructura simbólica de anillo. El diseño aerodinámico de la pieza se ve coherentemente en los brazos ajustables y en las patas de aluminio. Usted puede ver esta estructura de anillo icónico no sólo en la vista posterior, pero desde la vista frontal a través de la malla permeable.','• Sabrina Standard\r\n• Espalda extra alta / espalda alta\r\n• Sabrina Smart Operación\r\n• Espalda extra alta / espalda alta\r\n• Sabrina Standard\r\n• Base de piernas de cinco estrellas\r\n• Brazo 3D ajustable\r\n• Altura ajustable del asiento\r\n• Profundidad ajustable del asiento\r\n• Posiciones reclinables\r\n• Tensión reclinable ajustable\r\n• Syncro reclinable','Sin cabecera:\r\n• Ancho respaldo: 49.5 cm.\r\n• Bazo derecho-izquierdo: 69.5 cm. .\r\n• Ancho asiento: 53.5 cm.\r\n• Altura piso-brazo: 58cm – 78 cm.\r\n• Altura piso-asiento: 44 cm – 54 cm.\r\n• Diámetro base: 70 cm.\r\n• Perfil escoca: 56.5 -61.5 cm.\r\n• Largo asiento: 40 cm – 45 cm.\r\n• Altura total: 100 cm – 110 cm.\r\n\r\nTodos los accesorios:\r\n• Ancho respaldo: 49.5 cm.\r\n• Bazo derecho-izquierdo: 69.5 cm. .\r\n• Ancho asiento: 53.5 cm.\r\n• Altura piso-brazo: 58cm – 78 cm.\r\n• Altura piso-asiento: 44 cm – 54 cm.\r\n• Diámetro base: 70 cm.\r\n• Perfil escoca: 57 -62 cm.\r\n• Largo asiento: 40 cm – 45 cm.\r\n• Altura total: 119 cm – 129 cm.','Tela y mesh','• Marrón oscuro- marco negro\r\n• Azul- marco blanco\r\n• Beige- marco blanco\r\n• Gris claro - marco blanco \r\n• Negro- marco blanco y negro\r\n• Verde oscuro- marco negro.','products/sabrina-2f.jpg','2021-09-28 14:48:22.114398','2021-10-12','products/sabrina-1f.jpg','products/sabrina-7f.jpg','products/sabrina-6f.jpg'),(95,'CP','Okamura','Okamura CP es una silla ergonómica de vanguardia desarrollada en colaboración con la firma de diseño italiana de renombre mundial Giugiaro Design. Okamura CP combina la tecnología de asientos más avanzada del mundo con un diseño extraordinariamente simple para revitalizar cualquier espacio de oficina. Está disponible en una selección de 12 colores de malla.','•	Espalda de malla elástica\r\n•	Inclinación de tobillo sincro-reclinación\r\n•	Tensión reclinable ajustable\r\n•	Bloqueo de reclinación\r\n•	Ruedas de rodadura suave (60 mm de diámetro)\r\n•	Espalda alta / Espalda baja\r\n•	Asiento: Malla / Tapicería\r\n•	La malla y la tela están disponibles en 12 variaciones de color.\r\n•	Marco de aluminio: pulido o con recubrimiento de polvo\r\n•	Color del cuerpo: negro o blanco\r\n•	Apoyabrazos: Ajustable / Fijo / Sin brazos\r\n•	Ruedas: duras (nailon) / blandas (uretano)\r\n•	Reposacabezas (ajustable / fijo / ninguno)\r\n•	Perchero\r\n•	Soporte lumbar ajustable','• Ancho respaldo: 43 cm\r\n• Bazo derecho-izquierdo: 49 cm. .\r\n• Altura piso-brazo: 61.5cm – 84.2 cm.\r\n• Altura piso-asiento: 44 cm – 55 cm.\r\n• Altura piso-brazo:64 cm – 75 cm.\r\n• Diámetro base: 69.6cm.\r\n• Perfil escoca: 57.7 cm.\r\n• Largo asiento: 42.5 cm.\r\n• Altura total: 93 cm – 104 cm.','Mesh','Blanco','products/cp2.jpg','2021-09-28 14:52:01.430586','2021-10-12','products/cp1.jpg','products/cp3.jpg',''),(96,'Legender','Okamura','Legender es la última silla ejecutiva. Una combinación de funcionalidad, clase y elegancia, basada en nuestra experiencia en ergonomía y nuestra larga tradición de crear hermosos muebles. Cuero suave y flexible y diseño de clase mundial para los principales ejecutivos del mundo.','•	Mecanismo de operación inteligente\r\n•	Diseñado para adaptarse a su cuerpo y su estilo. Las características incluyen la Operación inteligente con ajuste de altura y bloqueo reclinable a su alcance, deslizamiento del asiento sensible y controles de tensión.\r\n•	Descanso con inclinación del tobillo Un mecanismo de inclinación con el tobillo permite a cualquier persona encontrar su posición de descanso más cómoda. Al usar el tobillo como punto de pivote, este mecanismo se mueve en sincronía con el asiento, para un mayor apoyo, estimulando la variación en la postura y la relajación, con comodidad ininterrumpida.\r\n•	Cojín de densidad múltiple\r\n•	El exclusivo Cojín de densidad múltiple de Okamura utiliza tres tipos de espuma de uretano, de firmeza variable en capas, para promover un asiento saludable. El cojín proporciona un soporte más suave en la parte delantera del asiento, reduciendo la presión sobre los muslos para mejorar la circulación; La amortiguación más densa en la parte posterior sostiene firmemente las caderas para una mayor estabilidad y una mejor postura.\r\n•	Ajuste de la altura y la profundidad del asiento Ajuste la altura de la silla, dentro de un rango de 17 3/8 \"(44lmm) a 21 3/4\" (55lmm), usando la palanca en el reposabrazos derecho. El ajuste de la profundidad del asiento, dentro de un rango de 2 \"(50 mm), está disponible usando las palancas debajo del asiento.\r\n•	Ajuste de tensión reclinada\r\n•	Elija entre cuatro ajustes preestablecidos de ajuste de tensión para un ajuste intuitivo, todo desde una esfera debajo del asiento.\r\n•	Opciones de estilo\r\n•	Respaldo extra alto / respaldo alto\r\n•	Opción de personalización\r\n•	Apoyabrazos: brazo cerrado / brazo abierto\r\n•	Opción de diseño de respaldo\r\n•	Estándar\r\n•	Puntadas\r\n•	Costura en cuero perforado.','Sin medidas','Piel','Negro y camel','products/legender-1.jpg','2021-09-28 14:57:50.165128','2021-10-12','products/legender-3.jpg','products/legender-4.jpg','products/legender-5.jpg'),(97,'RP-4500','Requiez','Sillón ejecutivo mesh / piel con cabecera, reclinamiento de respaldo synchronico con regulador de tensión, bloqueo antishock, descansabrazos con ajuste de altura, asiento ergonómico tapizado, cabecera acojinada con ajuste gradual y base de cinco puntas en nylon con cinturón de acero.','•	Synchro con regulador de tensión, 3 posiciones de bloqueo y sistema antishock.\r\n•	Mecanismo elaborado con placa de acero cal.10.                                                                                      \r\n•	Elevación neúmatica.                                                                                                                                   \r\n•	Descansabrazos con ajuste de altura.                                                                                                         \r\n•	Cabecera tapizada con ajuste de altura.                                                                                                        \r