inas: 210 cm.\r\n•	Altura cabina: 121.5 cm.\r\n•	Diámetro mesa: 90 cm.','Tela','•	Melocotón.\r\n•	Tomate.\r\n•	Frambuesa.\r\n•	Mermelada.\r\n•	Calabaza.\r\n•	Mostaza.\r\n•	Manzanilla.\r\n•	Pera\r\n•	Avena.\r\n•	Latte.\r\n•	Kiwi.\r\n•	Uva.\r\n•	Café.\r\n•	Marrón.\r\n•	Cacao.\r\n•	Vainilla.\r\n•	Hongo.\r\n•	Sésamo.\r\n•	Blackberry.\r\n•	Salvia.\r\n•	Ciruela.\r\n•	Índigo.\r\n•	Arándano.\r\n•	Huckleberry.\r\n•	Gris carbón.','products/muffle-b02.jpg','2021-09-28 21:41:15.945479','2021-10-18','','',''),(168,'Muffle C01','Okamura','Producto especial.','Producto especial.','Producto especial.','Producto especial.','Producto especial.','products/muffle-c01.jpg','2021-09-28 21:41:45.200733','2021-10-12','','',''),(169,'Muffle C02','Okamura','Producto especial.','Producto especial.','Producto especial.','Producto especial.','Producto especial.','products/muffle-c02.jpg','2021-09-28 21:44:59.734831','2021-10-12','','',''),(170,'Muffle B01','Okamura','Con personalidades y preferencias de estilo de trabajo tan diversas en la oficina, creemos que los entornos de trabajo deben ser adaptables. Muffle crea espacios dentro de oficinas abiertas que promueven diferentes niveles de concentración y colaboración.\r\nParte del trabajo se ve facilitado por un espacio aislado para la concentración individual. Otro trabajo es más adecuado para un entorno colaborativo más abierto. Muffle mejora el trabajo individual y grupal al proporcionar un espacio discreto con límites visuales y gestión acústica, complementado con soporte técnico integrado. Al reducir el exceso de estimulación sensorial, Muffle mitiga las distracciones y frena el estrés, mientras que la superficie acolchada y la tela suave crean un enfoque cálido y relajado. La multitud de opciones de color y diseño permite diversos espacios que satisfacen las necesidades de una variedad de trabajadores.','•	La mufla reduce la distracción del sonido con valores acústicos de NRC y SAA de 0,5.\r\n•	Los paneles circundantes vienen en varias op